  \"2013-03-28T01:13:50.819073\",\n\t\"name\": \"fsa-2008-digital-orthophoto-metadata\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains lines and/or polygons
  delineating the boundary between DOQQ imagery used in the creation of a compressed
  county mosaic (CCM). The DOQQ and CCM products were created from imagery acquired
  in the National Agriculture Imagery Program (NAIP). These boundary lines can be
  used as a tool in determining the image source and date of each portion of the CCM.
  The boundary lines separating each DOQQ may be the actual seam line location or
  an approximation. This is because the various vendors acquiring and processing the
  data use different algorithms to create the DOQQ and CCM products. Since the seam
  line may be an approximation, portions of the CCM along the boundary may actually
  come from the imagery on the other side of the seam line. NAIP acquires digital
  ortho imagery during the agricultural growing seasons in the continental U.S.. A
  primary goal of the NAIP program is to enable availability of ortho imagery within
  one year of acquisition. NAIP provides two main products: 1 meter ground sample
  distance (GSD) ortho imagery rectified to a horizontal accuracy of within +/- 5
  meters of reference digital ortho quarter quads (DOQQ's) from the National Digital
  Ortho Program (NDOP) or from the National Agriculture Imagery Program (NAIP); 1
  meter GSD ortho imagery rectified to within +/- 6 meters to true ground. The tiling
  format of NAIP imagery is based on a 3.75' x 3.75' quarter quadrangle with a 300
  meter buffer on all four sides. NAIP quarter quads are formatted to the UTM coordinate
  system using NAD83. NAIP imagery may contain as much as 10% cloud cover per tile.
  This file was generated by compressing NAIP quarter quadrangle tiles that cover
  a county. Two types of compression may be used for 2008 NAIP imagery: MrSID and
  JPEG 2000. Target values for the compression ratio are (15:1).\",\n\t\"license_title\":
